    boolean result = false;
    final DetailAST previous = token.getPreviousSibling();
    if (previous.getType() == TokenTypes.BLOCK_COMMENT_BEGIN
            && JavadocUtils.isJavadocComment(previous)) {
        result = true;
    }
    return result;
}
